var Logger={setLogLevel:function(e){if(e==null){$.sap.log.setLevel($.sap.log.Level.ERROR);return}e=e.toUpperCase();if(e==="FATAL"){$.sap.log.setLevel($.sap.log.Level.FATAL)}else if(e==="INFO"){$.sap.log.setLevel($.sap.log.Level.INFO)}else if(e==="NONE"){$.sap.log.setLevel($.sap.log.Level.NONE)}else if(e==="TRACE"){$.sap.log.setLevel($.sap.log.Level.TRACE)}else{$.sap.log.setLevel($.sap.log.Level.ERROR)}},error:function(e){$.sap.log.error(e)},fatal:function(e){$.sap.log.fatal(e)},info:function(e){$.sap.log.info(e)},trace:function(e){$.sap.log.trace(e)},showApplicationTrace:function(){try{var e=new sap.ui.commons.Dialog;e.setTitle("Application Trace");var t=new sap.ui.commons.TextArea;t.setCols(100);t.setRows(20);t.setEditable(false);var n=$.sap.log.getLogEntries();if(n!=undefined){var r=[];for(var i=0;i<n.length;i++){var s=n[i];var o=s.date+" "+s.time+": "+s.message;if(s.level==5){o+=" "+JSON.stringify(s.details)}r.push(o)}t.setValue(r.join("\n"));e.addContent(t)}e.setModal(true);e.setShowCloseButton(true);e.open()}catch(u){alert("Could not open the application trace: "+u)}}};$(document).keydown(function(e){if(e.ctrlKey&&e.shiftKey&&e.which===90){Logger.showApplicationTrace()}});if(typeof console==undefined){console={};console.log=function(){};console.debug=function(){};console.error=function(){};console.warning=function(){}}